import React from "react";
import Button from 'react-bootstrap/Button';
import CounterCon from "./contexts/CounterCon"

const Btn = () => {
return (
        <div>
            <CounterCon.consumer>
                {(data) => {
                    return (
                    <div>
                        <h3>conunter value is {data.value} </h3>
                        <Button variant="primary">incremement</Button>
                        <Button variant="secondary" >decrememet</Button>
                    </div>
                    )
                }}
            </CounterCon.consumer>
        </div>
    );
};

export default Btn
